clusterZone: "mordasiewicz.local"
controller:
  jenkinsAdminEmail: r.mordasiewicz@f5.com
  image: "robinhoodis/jenkins"
  tag: "2.332.1-52"
  tagLabel: 2.332.1-52
  disableRememberMe: true
  resources:
    requests:
      cpu: "200m"
      memory: "512Mi"
    limits:
      cpu: "2000m"
      memory: "4096Mi"
  installPlugins: []
  jenkinsUrl: http://jenkins.f5.mordasiewicz.com:8080
  installLatestSpecifiedPlugins: true
  JCasC:
    defaultConfig: true
    configScripts:
      custom-configs: |
        unclassified:
          gitSCM:
            globalConfigEmail: "robin@mordasiewicz.com"
            globalConfigName: "robinmordasiewicz"
        jenkins:
          systemMessage: "JCasC Version: 137"
        jobs:
          - script: >
              pipelineJob('create-jenkins-container') {
                properties {
                  githubProjectUrl('https://github.com/robinmordasiewicz/jenkins-pipeline')
                  pipelineTriggers {
                      triggers {
                        githubPush()
                      }
                   }
                }
                definition {
                  cpsScm {
                    scm {
                      git {
                        remote {
                          url('https://github.com/robinmordasiewicz/jenkins-pipeline.git')
                        }
                        branch('main')
                        extensions {}
                      }
                    }
                  }
                }
              }
          - script: >
              pipelineJob('create-nginx-container') {
                properties {
                  githubProjectUrl('https://github.com/robinmordasiewicz/nginx-pipeline')
                  pipelineTriggers {
                      triggers {
                        githubPush()
                      }
                   }
                }
                definition {
                  cpsScm {
                    scm {
                      git {
                        remote {
                          url('https://github.com/robinmordasiewicz/nginx-pipeline.git')
                        }
                        branch('main')
                        extensions {}
                      }
                    }
                  }
                }
              }
    securityRealm: |-
      local:
        allowsSignup: false
        enableCaptcha: false
        users:
        - id: "${chart-admin-username}"
          name: "Robin Mordasiewicz"
          password: "${chart-admin-password}"
          properties:
          - mailer:
              emailAddress: "r.mordasiewicz@f5.com"
          - "favorite"
          - preferredProvider:
              providerId: "org.jenkinsci.plugins.blueoceandisplayurl.BlueOceanDisplayURLImpl"
          - timezone:
              timeZoneName: "America/Toronto"
    authorizationStrategy: |-
      loggedInUsersCanDoAnything:
        allowAnonymousRead: false
agent:
  jenkinsUrl: http://jenkins:8080
  jenkinsTunnel: jenkins-agent:50000
  resources:
    requests:
      cpu: "2048m"
      memory: "2048Mi"
    limits:
      cpu: "2048m"
      memory: "2048Mi"
  podName: "jenkins-agent"
persistence:
  size: "20Gi"
serviceAccountAgent:
  create: true
credentials:
  system:
    domainCredentials:
    - credentials:
      - usernamePassword:
          description: "github-pat"
          id: "github-pat"
          password: "{AQAAABAAAAAwTqBv+pi4YGlKsul5q9/RhbtI342FNHxnKpuKQaH0IjVyEFE0PUTZkhk9VQ7AGh2RS1JD60oqH+bgVs8pMGlKww==}"
          scope: GLOBAL
          username: "github-pat"
      - file:
          description: "kubeconfig"
          fileName: "kubeconfig"
          id: "kubeconfig"
          scope: GLOBAL
          secretBytes: "{}"
